      var currentVidId = randomSiivaId();
      var previousVidId;
      var currentVidTitle;
      var titleUpdated = false;

      function randomSiivaId() {
        return siiva_vid_ids[Math.floor(Math.random()*siiva_vid_ids.length)];
      }

      function wikiLinkFromTitle(title, wikia='siivagunner') {
        return 'https://' + wikia + '.fandom.com/wiki/' + title.replaceAll(' ', '_').replaceAll(/[#|]+/gi,'').replaceAll('[','(').replaceAll(']',')');
      }

      // 2. This code loads the IFrame Player API code asynchronously.
      var tag = document.createElement('script');

      tag.src = "https://www.youtube.com/iframe_api";
      var firstScriptTag = document.getElementsByTagName('script')[0];
      firstScriptTag.parentNode.insertBefore(tag, firstScriptTag);

      // 3. This function creates an <iframe> (and YouTube player)
      //    after the API code downloads.
      var player;
      function onYouTubeIframeAPIReady() {
        player = new YT.Player('player', {
          height: '390',
          width: '640',
          videoId: currentVidId,
          autoplay: '1',
          enablejsapi: '1',
          events: {
            'onReady': onPlayerReady,
            'onStateChange': onPlayerStateChange,
            'onError': onError
          }
        });
      }

      // 4. The API will call this function when the video player is ready.
      function onPlayerReady(event) {
        currentVidTitle = player.getVideoData().title;
        updateWikiLink();
        player.playVideo();
      }

      function updateWikiLink() {
        document.getElementById("rip_wiki_link").childNodes[0].href = wikiLinkFromTitle(currentVidTitle);
      }

      function skipVid() {
        newVid();
      }

      function copyRipLink() {
        var input = document.createElement('textarea');
        input.innerHTML = "https://www.youtube.com/watch?v=" + currentVidId;
        document.body.appendChild(input);
        input.select();
        var result = document.execCommand('copy');
        document.body.removeChild(input);
      }

      function newVid() {
        previousVidId = currentVidId;
        currentVidId = randomSiivaId();
        titleUpdated = false;
        player.loadVideoById(currentVidId);
      }

      function onError(event) {
        if (event.data >= 100) {
          newVid();
        }
      }

      // 5. The API calls this function when the player's state changes.
      //    The function indicates that when playing a video (state=1),
      //    the player should play for six seconds and then stop.
      function onPlayerStateChange(event) {
        if (event.data == YT.PlayerState.ENDED) {
          newVid();
        } else if (event.data == YT.PlayerState.PLAYING && !titleUpdated) {
          currentVidTitle = player.getVideoData().title;
          titleUpdated = true;
          updateWikiLink();
        }
      }
      function previousVid() {
        var swap = currentVidId;
        currentVidId = previousVidId;
        previousVidId = swap;
        titleUpdated = false;
        player.loadVideoById(currentVidId);
      }
    </script>
